                                    <h1>Hello</h1>
                                    <input type="file" id="image" className='imageInput' onChange={ handleUploadCoverImage } />
                                </div>
                            </div>
                        </div>
                    </div>
                }
            </div>
        </div>
    </div>
  )
}

export default MainPage
